import React from 'react';
import './Products.css';

function Products() {
  return (
    <>
        <div className='all-products'>
            <div className='wrapper'></div>
                <div className='top_bar'>
                    <ul>
                        <li>Home</li>
                        <li>/</li>
                        <li>Products</li>
                    </ul>
                </div>
        </div>
    </>
  )
}

export default Products;
